Returns the last access time of the file, in nanoseconds since [`st_atime`].

[`st_atime`]: Self::st_atime

# Examples

```no_run
use std::fs;
use std::io;
use std::os::linux::fs::MetadataExt;

fn main() -> io::Result<()> {
    let meta = fs::metadata("some_file")?;
    println!("{}", meta.st_atime_nsec());
    Ok(())
}
```
